	add("patsy", "{\"term\":\"patsy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The term dates back at least to the 1870s in the United States, close to the peak of Irish migration.The \u0027OED\u0027\u0027s recent revisions link \u0027Patsy\u0027 with \u0027Pat\u0027 and \u0027Paddy\u0027, the stereotype of the bogtrotter just off the boat.The American Heritage Dictionary and [http://www.etymonline.com Online Etymology Dictionary] quotes the OED it may derive from the Italian \u0027pazzo\u0027 (\u0026quot;madman\u0026quot; ), and south Italian dialect \u0027paccio\u0027 (\u0026quot;fool\u0026quot;).Another possibility is the term derives from w:Patsy Bolivar|Patsy Bolivar, a character in an 1880s minstrel skit who was blamed whenever anything went wrong, in Broadway musical comedies, for example in \u0027The Errand Boy\u0027 [1904] and \u0027Patsy in Politics\u0027 [1907].\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is taken advantage of, especially by being cheated or blamed for something\", \"priority\":1}]}, \"synonyms\":{}}");

