	add("patten", "{\"term\":\"patten\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027paten\u0027 \u0027\u0027 \u0027\u0027 from Anglo-norman \u0027patin\u0027 Middle french (ca. 1400-1600) \u0027patin\u0027 from \u0027patte\u0027 () from Latin \u0027patta\u0027 of imitative origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various types of footwear with thick soles, often used to elevate the foot, especially wooden clogs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1660\u0027\u0027, \u0027Diary\u0027, 24 Jan 1660\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I went and told part of the excise money till twelve o’clock, and then called on my wife and took her to Mr. Pierces, she in the way being exceedingly troubled with a pair of new \u0027\u0027pattens\u0027\u0027, and I vexed to go so slow, it being late\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Tom Freckle, the smith\u0027s son, was the next victim to her rage. He was an ingenious workman, and made excellent \u0027\u0027pattens\u0027\u0027; nay, the very \u0027\u0027patten\u0027\u0027 with which he was knocked down was his own workmanship\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A stilt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pattern", "{\"term\":\"pattern\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027patron\u0027 from \u0027patronus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Model, example\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something from which a copy is made; a model or outline\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, ‘President Wilson’, \u0027Time\u0027, 18 Jun 1923\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There is no reason why all colleges and universities should be cut to the same \u0027\u0027pattern\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Someone or something seen as an example to be imitated; an exemplar\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1946\u0027\u0027, Bertrand Russell, \u0027History of Western Philosophy\u0027, I.16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Platonic Socrates was a \u0027\u0027pattern\u0027\u0027 to subsequent philosophers for many ages\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A copy\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A sample; of coins, an example which was struck but never minted\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A representative example\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The material needed to make a piece of clothing\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The paper or cardboard template from which the parts of a garment are traced onto fabric prior to cutting out and assembling\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A full-sized model around which a mould of sand is made, to receive the melted metal. It is usually made of wood and in several parts, so as to be removed from the mould without damage\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A text string containing wildcards, used for matching\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"There were no files matching the \u0027\u0027pattern\u0027\u0027 \u0026lt;code\u0026gt;*.txt\u0026lt;/code\u0026gt\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A design, motif or decoration, especially formed from regular repeated elements\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Valentino, ‘Is there a future in fashion\u0027s past?’, \u0027Time\u0027, 5 Feb 2003\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"On my way to work the other day, I stopped at a church in Rome and saw a painting of the Madonna. The subtle \u0027\u0027pattern\u0027\u0027 of blues and golds in the embroidery of her dress was so amazing that I used it to design a new evening dress for my haute couture\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A naturally-occurring or random arrangement of shapes, colours etc. which have a regular or decorative effect\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Rachel Cooke, \u0027The Observer\u0027, 19 Jun 2011\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"He lifted the entire joint or fowl up into the air, speared on a carving fork, and sliced pieces off it so that they fell on the plate below in perfectly organised \u0027\u0027patterns\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The given spread, range etc. of shot fired from a gun\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A particular sequence of events, facts etc. which can be understood, used to predict the future, or seen to have a mathematical, geometric, statistical etc. relationship\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, ‘Shifting Targets’, \u0027Time\u0027, 6 Oct 1980\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The three killings pointed to an ugly new shift in the enduring \u0027\u0027pattern\u0027\u0027 of violence in Northern Ireland: the mostly Protestant Ulster police, or those suspected of affiliation with them, have become more prominent targets for the I.R.A. than the British troops\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Kate Hudson, \u0027The Guardian\u0027, 14 Aug 2003\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"Look again at how the US and its allies behaved then, and the \u0027\u0027pattern\u0027\u0027 is unmistakable\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"An intelligible arrangement in a given area of language\", \"priority\":28}]}, \"synonyms\":{}}");

